*/
const routers = [
  {
    path: 'https://www.baidu.com/',
    name: 'jcfxyp',
    component: () => import('@/views/zhscjd/scwtysl/index'),
    meta: { title: '大数据应用系统', icon: 'iconfont icon-dian' }
  },
  {
    path: '/jcfxyp/dzjz',
    component: () => import('@/views/zhajgl/ajfxyp/dzjz/index'),
    meta: { title: '电子卷宗', icon: 'iconfont icon-dian' }
