  {
    path: '/jcfxyp/gkqk',
    component: () => import('@/views/zhajgl/ajfxyp/gkqk/index'),
    meta: { title: '公开情况', icon: 'iconfont icon-dian' }
  },
  {
    path: '/jcfxyp/sacw',
    component: () => import('@/views/zhajgl/ajfxyp/sacw/index'),
    meta: { title: '涉案财物', icon: 'iconfont icon-dian' }
  },
  {
    path: '/jcfxyp/lsbhr',
    component: () => import('@/views/zhajgl/ajfxyp/lsbhr/index'),
    meta: { title: '律师辩护人', icon: 'iconfont icon-dian' }
  },
  {
    path: '/jcfxyp/hdsstj',
    component: () => import('@/views/jcfxyp/ajpc/hdsstj'),
